%[text] # Create Building Model Part Using Utilities
%[text] Copyright 2024 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_D8FF8C6F] This project shows how to define a building's floor plan by starting with the layout and definition of individual rooms. In this project, a building consists of multiple apartments, each containing various rooms such as a living room, kitchen, bathroom, and bedroom. A single building can contain several apartments. The orientation of the floor plan of an apartment must be defined in reference with global directions: North (N), East (E), South (S), and West (W). The project uses specific convention to indicate directions on a 2D plot. This workflow guides you through orienting your floor plan in the desired direction and adding windows and vents to the external walls.
%[text]{"align":"center"} ![directionConventionUsed.png](text:image:16b8)
%[text] Once your floor plan is prepared, you will construct a 3D building by extending the floor plan in the z-direction, or the vertical axis. All of the windows and vents on a particular wall are uniform in size across the different floor levels. This process is illustrated in the diagram below and described in detail in the following sections.
%[text]{"align":"center"} ![overallSummaryBuildingConstruction.png](text:image:8272)
%[text] ## Define Rooms
%[text] Use the function `addRoomToFloorPlan()` to add the room to the apartment unit. See [Function Reference List](file:../Components/WorkflowUtilities/UtilityDocumentation/FunctionReferenceList.html) for more details on the function.
% Initialize a data struct for one apartment unit.
oneAptUnit  = []; 

% Living Room
oneAptUnit   = addRoomToFloorPlan(FloorPlan=oneAptUnit,...
                                  NewRoom="LivingRoom",...
                                  Vertex=simscape.Value([0,0],"ft"),...
                                  Length=simscape.Value(8,"ft"),...
                                  Width=simscape.Value(10,"ft"));

% Bedroom
oneAptUnit   = addRoomToFloorPlan(FloorPlan=oneAptUnit,...
                                  NewRoom="Bedroom",...
                                  Vertex=simscape.Value([10,-2],"ft"),...
                                  Length=simscape.Value(14,"ft"),...
                                  Width=simscape.Value(10,"ft"));
% Kitchen
oneAptUnit   = addRoomToFloorPlan(FloorPlan=oneAptUnit,...
                                  NewRoom="Kitchen",...
                                  Vertex=simscape.Value([2,-6],"ft"),...
                                  Length=simscape.Value(6,"ft"),...
                                  Width=simscape.Value(8,"ft"));
% Bathroom
oneAptUnit   = addRoomToFloorPlan(FloorPlan=oneAptUnit,...
                                  NewRoom="Bathroom",...
                                  Vertex=simscape.Value([3,8],"ft"),...
                                  Length=simscape.Value(5,"ft"),...
                                  Width=simscape.Value(7,"ft"));

% Fire Exit
oneAptUnit   = addRoomToFloorPlan(FloorPlan=oneAptUnit,... %[output:group:4eeccb3d] %[output:50400030]
                                  NewRoom="FireExit",... %[output:50400030]
                                  Vertex=simscape.Value([-2,-5],"ft"),... %[output:50400030]
                                  Length=simscape.Value(5,"ft"),... %[output:50400030]
                                  Width=simscape.Value(4,"ft"),... %[output:50400030]
                                  Plot=true); %[output:group:4eeccb3d] %[output:50400030]
%[text] ## Define Apartment
%[text] Define one apartment unit.
modelApt = defineSingleApartmentUnit(Apartment=oneAptUnit,...
                                     Tol=0.01);

clear room oneAptUnit
%[text] You can use the `copyMoveRotateForNewApartment` function to duplicate the apartment by either moving it a specified distance or rotating it. The following code keeps the apartment stationary but rotates it by 15 degrees around *Bedroom*'s vertex.
apartment  = copyMoveRotateForNewApartment(Apartment=modelApt,...
                                           MoveDistance=simscape.Value([0,0],"ft"),...
                                           RotationAngle=simscape.Value(15,"deg"),...
                                           RotateAboutRoom="Bedroom",...
                                           Tol=0.01);
%[text] ## Modify Apartment Walls
%[text] The `defineSingleApartmentUnit` finds the room to room connectivity automatically. It assumes that all rooms have solid walls between them. To specify a gap or an opening (door, window, or completely remove wall) between two rooms, you must specify the wall fraction value between them. A value of 1 denotes a solid wall between two adjacent rooms while a value of 0 denotes no wall between the two rooms. An intermediate value represents a door or an opening in the wall. 
%[text] Display the value of room to room connectivity and associated wall fraction value.
aptTbl = getApartmentRoomConnectivity(Apartment=apartment);
disp(aptTbl); %[output:8309f237]
%[text] Define the following internal wall openings:
%[text] - Add a door between **LivingRoom** and **Kitchen**, with `Solid Wall Fraction` = 0.5. \
aptTbl(and(aptTbl.RoomA=="LivingRoom",...
           aptTbl.RoomB=="Kitchen"),:).("Solid Wall Fraction") = 0.5;
%[text] - Add a door between **Bedroom** and **Bathroom**, with `Solid Wall Fraction` = 0.75. \
aptTbl(and(aptTbl.RoomA=="Bedroom",...
           aptTbl.RoomB=="Bathroom"),:).("Solid Wall Fraction") = 0.75;
%[text] - Add a door between **LivingRoom** and **Bedroom**, with `Solid Wall Fraction` = 0.75. \
aptTbl(and(aptTbl.RoomA=="LivingRoom",...
           aptTbl.RoomB=="Bedroom"),:).("Solid Wall Fraction") = 0.75;
%[text] - Add a door between **LivingRoom** and **FireExit**, with `Solid Wall Fraction` = 0.5. \
aptTbl(and(aptTbl.RoomA=="LivingRoom",...
           aptTbl.RoomB=="FireExit"),:).("Solid Wall Fraction") = 0.5;
%[text] Update the room connectivity data.
apartment = updateApartmentRoomConnectivity(Apartment=apartment,...
                                            ConnectionTable=aptTbl);
%[text] Check the updates made to the connectivity data.
updatedTbl = getApartmentRoomConnectivity(Apartment=apartment);
disp(updatedTbl); clear updatedTbl aptTbl; %[output:3092270f]
%[text] ## Define Floor-plan
%[text] Define the floor plan by consolidating all apartment definitions into a single cell array. The following code defines the floor-plan using just one apartment.
floorPlan = defineBuildingFloorPlan(Apartments={apartment});
%[text] Plot and visualize the floor-plan.
figure("Name","Floor Plan Consolidated"); %[output:91a9838d]
plotFloorPlanLayout(PlotData=floorPlan,Type="floorplan") %[output:91a9838d]
%[text] ## Modify External Walls
%[text] %[text:anchor:H_524237F2] Visualize all the external walls and their identification numbers.
tblWinVentData = visualizeBuildingWallsToAddWindowsVents(FloorPlan=floorPlan,... %[output:group:8c7b4af9] %[output:804a9e91] %[output:56743d48]
                                                         Plot=true,... %[output:804a9e91] %[output:56743d48]
                                                         Tol=0.01); %[output:group:8c7b4af9] %[output:804a9e91] %[output:56743d48]
tblWinVentData.("Overlap Vertices") = [];
%[text] Add windows to a specified set of wall sections. Each row entry below represents a unique wall specification. The first two columns define the wall section indices, while the third column indicates the fraction of the total wall area covered by windows or vents. In this example, walls represented by indices 1-2, 4-5, 7-8, 8-9, and 10-11 have windows with areas specified as 70%, 30%, 70%, 50%, and 70% of the respective wall area.
windowData = [1,2,0.7; ...
              2,3,0.5; ...
              4,5,0.3; ...
              7,8,0.7; ...
              8,9,0.5; ...
              9,10,0.7; ...
              10,11,0.7; ...
              12,13,0.6];

updatedTblWinVentData = updateWindowVentDataToTable(DataTable=tblWinVentData,... %[output:group:845c6757] %[output:144d71b2]
                                                    OpeningData=windowData); %[output:group:845c6757] %[output:144d71b2]

updatedFloorPlan = addOpeningOnWallSection(FloorPlan=floorPlan,...
                                           Data=updatedTblWinVentData);
%[text] ## Define Building
%[text] Set angle to view all 3D plots.
viewingAngle = [-1 -1 1]; 
%[text] Generate building 3D model with 3 levels and each level height.
building = generateBuilding3Dlayout(BuildingName="BuildingUnit",...
                                    BuildingFloorPlan=updatedFloorPlan,...
                                    NumberOfLevels=3,...
                                    LevelHeight=simscape.Value(10,"ft"),...
                                    Tol=0.01);
%[text] ## Modify Building Walls and Floor
%[text] Display room connectivity data for the building to update room connectivity in the building.
bldgTbl = getBuildingRoomConnectivity(Building=building);
disp(bldgTbl); %[output:6c3bd961]
%[text] The **FireExit** has stairs and different levels are connected in vertical direction. Update this room connectivity information for all **FireExit** rooms. Find the list of entries where different **FireExit** rooms connect with each other.
listOfEntries = bldgTbl(and(bldgTbl.RoomA=="FireExit",...
                            bldgTbl.RoomB=="FireExit"),:);
%[text] Set the `Solid Wall Fraction` value as 0.5.
fireExitWallFrac = 0.5;
bldgTbl(and(bldgTbl.RoomA=="FireExit",...
            bldgTbl.RoomB=="FireExit"),:).("Solid Wall Fraction") = ...
            fireExitWallFrac*ones(size(listOfEntries,1),1);
clear listOfEntries fireExitWallFrac
%[text] Update building data struct.
bldg = updateBuildingRoomConnectivity(Building=building,ConnectionTable=bldgTbl);
%[text] Check if updates have been applied to the building data.
chkData = getBuildingRoomConnectivity(Building=bldg);
disp(chkData); clear chkData bldgTbl; %[output:6684f8b6]
%[text] Plot building.
figure("Name","BuildingUnit Elevation"); %[output:1db28dc1]
plot3DlayoutBuilding(Building=building,... %[output:group:409d5ca5] %[output:1db28dc1]
                     PlotViewDirection=viewingAngle,... %[output:1db28dc1]
                     ColorScheme="simple",... %[output:1db28dc1]
                     InternalWalls=false,... %[output:1db28dc1]
                     DebugMode=false); %[output:group:409d5ca5] %[output:1db28dc1]
%[text] %[text:anchor:H_B2B3A160] ## Save Building Data
%[text] Save the building data in an XML file. You can load this part file later and use it for analysis. All this data is saved in folder `ScriptsData/Parts`.
writeBuildingDataXML(Building=building,FileName="BuildingModelPartUsingUtilities.xml"); %[output:12ee4f2e]

